import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from './Header';
import Principal from './Principal';
function App() {
  return (
    <div className="App">
      <Header/>
      <Principal/>
        <Routes>
          <Route path={"/"} element={<Principal/>}/>
        </Routes>
    </div>
  );
}

export default App;
